ind_1997\" title=\"Candle in the Wind 1997\">Candle in the Wind<\/a>\u00bb, \u043f\u043e\u0441\u0432\u044f\u0449\u0451\u043d\u043d\u0430\u044f \u043f\u0430\u043c\u044f\u0442\u0438 \u043f\u0440\u0438\u043d\u0446\u0435\u0441\u0441\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B8%D0%B0%D0%BD%D0%B0,_%D0%BF%D1%80%D0%B8%D0%BD%D1%86%D0%B5%D1%81%D1%81%D0%B0_%D0%A3%D1%8D%D0%BB%D1%8C%D1%81%D0%BA%D0%B0%D1%8F\" title=\"\u0414\u0438\u0430\u043d\u0430, \u043f\u0440\u0438\u043d\u0446\u0435\u0441\u0441\u0430 \u0423\u044d\u043b\u044c\u0441\u043a\u0430\u044f\">\u0414\u0438\u0430\u043d\u044b<\/a>, \u0441\u0442\u0430\u043b\u0430 \u0441\u0430\u043c\u044b\u043c \u043f\u043e\u043f\u0443\u043b\u044f\u0440\u043d\u044b\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B8%D0%BD%D0%B3%D0%BB\" title=\"\u0421\u0438\u043d\u0433\u043b\">\u0441\u0438\u043d\u0433\u043b\u043e\u043c<\/a> \u0432 \u0438\u0441\u0442\u043e\u0440\u0438\u0438 \u043f\u043e\u043f-\u043c\u0443\u0437\u044b\u043a\u0438: \u0432 \u0442\u0435\u0447\u0435\u043d\u0438\u0435 \u043c\u0435\u0441\u044f\u0446\u0430 \u0431\u044b\u043b\u043e \u043f\u0440\u043e\u0434\u0430\u043d\u043e 31,8 \u043c\u0438\u043b\u043b\u0438\u043e\u043d\u0430 \u044d\u043a\u0437\u0435\u043c\u043f\u043b\u044f\u0440\u043e\u0432.<\/li><\/ul><\/li><\/ul><h3><a href=\"https:\/\/ru.wikipedia.org\/wiki\/XXI_%D0%B2%D0%B5%D0%BA\" title=\"XXI \u0432\u0435\u043a\">XXI \u0432\u0435\u043a<\/a> <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2002\" class=\"mw-redirect\" title=\"2002\">2002<\/a><ul><li>\u041f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%80%D0%B0%D0%BA\" title=\"\u0418\u0440\u0430\u043a\">\u0418\u0440\u0430\u043a\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%B4%D0%B4%D0%B0%D0%BC_%D0%A5%D1%83%D1%81%D0%B5%D0%B9%D0%BD\" title=\"\u0421\u0430\u0434\u0434\u0430\u043c \u0425\u0443\u0441\u0435\u0439\u043d\">\u0421\u0430\u0434\u0434\u0430\u043c \u0425\u0443\